import Command from "./Command"

const RemoveDocument = (...args) => {
    Command.apply(this,args);
}

RemoveDocument.prototype.execute = () => {
    this._middleware.removeDocument(this._object);
}

RemoveDocument.prototype.unexecute = () => {
    this._middleware.addDocument(this._object);
}
